#
# TABLE STRUCTURE FOR: admin
#

DROP TABLE IF EXISTS `admin`;

CREATE TABLE `admin` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `password` varchar(11) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: auto
#

DROP TABLE IF EXISTS `auto`;

CREATE TABLE `auto` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `model` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `make_id` int(8) NOT NULL,
  `category_id` int(8) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=157 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: auto_category
#

DROP TABLE IF EXISTS `auto_category`;

CREATE TABLE `auto_category` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: client
#

DROP TABLE IF EXISTS `client`;

CREATE TABLE `client` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `full_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `discount` float NOT NULL DEFAULT 0,
  `password` varchar(7) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=133 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: detail
#

DROP TABLE IF EXISTS `detail`;

CREATE TABLE `detail` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `amount` int(4) NOT NULL,
  `price` float NOT NULL DEFAULT 0,
  `auto_id` int(8) NOT NULL,
  `category_id` int(8) NOT NULL,
  `warehouse_id` int(8) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3470 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: detail_category
#

DROP TABLE IF EXISTS `detail_category`;

CREATE TABLE `detail_category` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: make
#

DROP TABLE IF EXISTS `make`;

CREATE TABLE `make` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: purchase
#

DROP TABLE IF EXISTS `purchase`;

CREATE TABLE `purchase` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `client_id` int(8) NOT NULL,
  `amount` int(4) NOT NULL,
  `date_time` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `detail_id` int(8) NOT NULL,
  `worker_id` int(8) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8966 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: system
#

DROP TABLE IF EXISTS `system`;

CREATE TABLE `system` (
  `password` varchar(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`password`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: warehouse
#

DROP TABLE IF EXISTS `warehouse`;

CREATE TABLE `warehouse` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `address` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `phone` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: worker
#

DROP TABLE IF EXISTS `worker`;

CREATE TABLE `worker` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `password` varchar(9) COLLATE utf8_unicode_ci NOT NULL,
  `rating` decimal(10,10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# FOREIGN KEYS
#

ALTER TABLE `detail` ADD CONSTRAINT `detail_fk0` FOREIGN KEY (`auto_id`) REFERENCES `auto`(`id`);
ALTER TABLE `detail` ADD CONSTRAINT `detail_fk1` FOREIGN KEY (`category_id`) REFERENCES `detail_category`(`id`);
ALTER TABLE `detail` ADD CONSTRAINT `detail_fk2` FOREIGN KEY (`warehouse_id`) REFERENCES `warehouse`(`id`);
ALTER TABLE `auto` ADD CONSTRAINT `auto_fk0` FOREIGN KEY (`make_id`) REFERENCES `make`(`id`);
ALTER TABLE `auto` ADD CONSTRAINT `auto_fk1` FOREIGN KEY (`category_id`) REFERENCES `auto_category`(`id`);
